import React from "react";

export const Meme = ({ template, onClick }) => {
  return (
    <img
      style={{ border: 5, maxWidth: 200, maxHeight: 200 }}
      key={template.id}
      src={template.url}
      alt={template.name}
      onClick={onClick}
    />
  );
};
